#include <unistd.h>
#include <stdio.h>
#include <stdlib.h>

# define FALSE 0
# define TRUE 1
# define ALL -1

size_t	ft_strlen(const char *str)
{
	unsigned long len = 0;

	while (str[len] != '\0')
		len++;

	return (len);
}

void	ft_freestrtabn(char **tab, size_t size, int freeMainTab)
{

	if (!tab || size == 0)
		return ;

	for (size_t i = 0; i < size && tab[i]; i++) {
		free(tab[i]);
		tab[i] = NULL;
	}

	if (freeMainTab)
		free(tab);
}

char	*ft_strncpy(char *dest, const char *src, size_t n)
{
	unsigned long i;

	for (i = 0; i < n && src[i] != '\0'; i++)
		dest[i] = src[i];

  dest[i] = '\0';

	return (dest);
}

char	*ft_strnew(size_t len)
{
	char *new;

	return((new = (char *)malloc(sizeof(char) * (len + 1))));
}

char	*ft_strndup(const char *toDup, size_t n)
{
	char	*dup;

	if (!(dup = ft_strnew(n)))
		return (NULL);

	ft_strncpy(dup, toDup, n);

	return (dup);
}

int		ft_strichr(const char *s, const unsigned char c)
{
  if (c == '\0')
    return !s ? 0 : ft_strlen(s);

	for (size_t i = 0; s[i] != '\0'; i++)
		if (s[i] == c) return (i);

	return (-1);
}

